import React, { useState, useEffect } from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Main  from './components/Main';

function App() {

  return (
    <BrowserRouter>
      <Routes>
        <Route path="/main1" element={<Main/>} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
